// ELEMENTS
import { Grid } from '../elements/index';

import CommunityPost from '../components/CommunityPost'

const CommunityPostList = () => {
  return (
    <Grid>
      <CommunityPost/>
      <CommunityPost/>
      <CommunityPost/>
      <CommunityPost/>
    </Grid>
  );
};

export default CommunityPostList;
